import React from 'react';
import ChristianDrinking from '../images/team/ChristianDrinking.jpg';
import HeaderSection from './components/HeaderSection';
import Team from './components/Team';
import Beer from './components/beer';
import Platforms from './components/Platforms';

const Home = () => {
  const rowStyle = {
    width: "100%",
    maxWidth: "400px",
    maxHeight: "400px",
    position: "absolute",
    transform: "translate(-50%, -50%)",
    left: '50%',
    top: '50%',
    boxShadow: "0 .5rem 1rem #fff",
  }

  return (
    <div className="container-fluid" style={{maxWidth: "1400px", height: "100vh"}}>
      <img src={ChristianDrinking} class="p-3 mb-5 bg-white rounded" alt="Shane" height="400px" width="400px" style={rowStyle}/>
        </div>
  )
}

export default Home;
